import React from "react";
import MainSection from "./main-sections.component";
import Divider from '@mui/material/Divider';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import GitHubIcon from '@mui/icons-material/GitHub';
import EmailIcon from '@mui/icons-material/Email';

const styles = {

  largeIcon: {
    width: 60,
    height: 60,
  },

};

const ContactSection = () => {
    return(
        <div>
            <MainSection
                style={{ position: 'sticky', top: 0, zIndex: 1, background: 'white', padding: '20px' }}
                id='Home'
                content={
                    <div>
                        <h1>Contact</h1>
                            <div >
                                <a href='https://www.linkedin.com/in/nikkodumrique/' target='_blank'>
                                <LinkedInIcon iconSty style={{color: '#fff', marginRight: '2rem'}}></LinkedInIcon>
                                </a>
                                <a href='https://github.com/nkoda' target='_blank'>
                                <GitHubIcon size={40} style={{color: '#fff', marginRight: '2rem'}}></GitHubIcon>
                                </a>
                                <a href='mailto:dumriquenikko@gmail.com'>
                                <EmailIcon size={40} style={{color: '#fff'}}></EmailIcon>
                                </a>
                            </div>
                    </div>
                }/>
            <Divider></Divider>
        </div>
    )
}

export default ContactSection;
